package utils;

import java.util.List;

public class Jsondata {
	List rows;
	int total;
	public Jsondata() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Jsondata(List rows, int total) {
		super();
		this.rows = rows;
		this.total = total;
	}
	public List getRows() {
		return rows;
	}
	public void setRows(List rows) {
		this.rows = rows;
	}
	public int getTotal() {
		return total;
	}
	public void setTotal(int total) {
		this.total = total;
	}
	
}
